            "WEBMOB_device_washer_laundryout_desc": "Ha bármilyen ruhanemű maradt a mosógépben a mosás bfejezése után, a mobil alkalmazás értesítést küld az alábbi lehetőségek alapján. Az értesítés maximum 12 órán keresztül folytatódik, és akkor ér véget, amikor kinyitja az ajtót.<br>(A dob esetlegesen forgásban marad, hogy megelőzze a ruhák összegyűrődését és összegabalyodását.)",
