            "WEBMOB_device_washer_freeze_protection_desc": "Ako podesite alarm koji upozorava na smrzavanje, on će se oglasiti najviše 3 puta na svakih 30 minuta kada spoljna temperatura padne na 2 ℃. Kada je aktivna funkcija zaštite od smrzavanja, voda se iznova dovodi u mašinu i odvodi iz nje kako se preostala voda ne bi zaledila.",
