            "WEBMOB_device_washer_laundryout_desc": "Nach Beenden des Waschgangs erinnert Sie die App in den von Ihnen ausgewählten Intervallen, die Wäsche aus der Trommel zu entnehmen. Die Erinnerung wiederholt sich bis zu 12 Stunden und endet mit dem Öffnen der Waschmaschinen-Tür.<br>(Die Trommel kann sich gelegentlich drehen um einfaches Entnehmen der Wäsche zu ermöglichen und starkem Verknittern der Wäsche vorzubeugen.)",
            "WEBMOB_device_washer_laundryout_desc_dryer": "Wenn nach dem Trocknen noch Wäsche im Trockner bleibt, wird Ihnen dies entsprechend der folgenden Auswahl von Ihrer Mobilgeräte-App gemeldet. Diese Benachrichtigung wird maximal 12 Stunden, jedoch nur so lange versendet, bis Sie die Tür des Trockners öffnen.<br>(Die Trommel dreht sich gelegentlich, damit die Wäsche sich nicht verheddert und zerknittert.)",
