            "WEBMOB_device_washer_laundryout_desc_top_loader": "Nach Beenden des Waschgangs erinnert Sie die App in den von Ihnen ausgewählten Intervallen, die Wäsche aus der Trommel zu entnehmen. Die Erinnerung wiederholt sich bis zu 12 Stunden und endet mit dem Öffnen der Waschmaschinen-Tür.",
            "WEBMOB_device_washer_add_wash_desc": "Wenn Sie Wäsche nur kurz spülen oder schleudern oder einen besonderen Weichspüler während des Waschvorgangs zugeben möchten, erinnert der &quot;Wäsche hinzugeben&quot;-Alarm Sie daran, wann Sie zusätzliche Wäsche oder Weichspüler während des Waschvorgangs zugeben können.",
